import { Link } from 'react-router-dom';

function Team ({ team }) {
  return (
    <Link to="/team" state={{ team }}>
      <img  src={team.logo} style={ { width: '150px' } } alt="League logo"/>
      {team.name} / {team.city}
      {/* {name} / {city} / {founded} / {id} / {details} */}
    </Link>
  );
}

Team.defaultProps = {
  team: {},
};

export default Team;
